{"strNational":null,"strProfessional":"","strInternational":"","strEvents":"<h3>\u0414\u043e XX \u0432\u0435\u043a\u0430 <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/627_%D0%B3%D0%BE%D0%B4\" title=\"627 \u0433\u043e\u0434\">627<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%9D%D0%B8%D0%BD%D0%B5%D0%B2%D0%B8%D0%B8\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041d\u0438\u043d\u0435\u0432\u0438\u0438\">\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041d\u0438\u043d\u0435\u0432\u0438\u0438<\/a>&#160;\u2014 \u043a\u043b\u044e\u0447\u0435\u0432\u043e\u0435 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%B0%D0%BD%D0%BE-%D0%B2%D0%B8%D0%B7%D0%B0%D0%BD%D1%82%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(602%E2%80%94628)\" title=\"\u0418\u0440\u0430\u043d\u043e-\u0432\u0438\u0437\u0430\u043d\u0442\u0438\u0439\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (602\u2014628)\">\u0432\u0438\u0437\u0430\u043d\u0442\u0438\u0439\u0441\u043a\u043e-\u043f\u0435\u0440\u0441\u0438\u0434\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> \u043d\u0430\u0447\u0430\u043b\u0430 VII \u0432\u0435\u043a\u0430 \u0438 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0435\u0435 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BC%D1%81%D0%BA%D0%BE-%D0%BF%D0%B5%D1%80%D1%81%D0%B8%D0%B4%D1%81%D0%BA%D0%B8%D0%B5_%D0%B2%D0%BE%D0%B9%D0%BD%D1%8B\" title=\"\u0420\u0438\u043c\u0441\u043a\u043e-\u043f\u0435\u0440\u0441\u0438\u0434\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u043d\u044b\">\u0440\u0438\u043c\u0441\u043a\u043e-\u043f\u0435\u0440\u0441\u0438\u0434\u0441\u043a\u0438\u0445 \u0432\u043e\u0439\u043d<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0441 \u043f\u0435\u0440\u0435\u0440\u044b\u0432\u0430\u043c\u0438 \u0442\u044f\u043d\u0443\u043b\u0438\u